  def getSrcData(): Array[Article] = {
    val t = "李时珍为何弃文从医? 乡试多次均失败 体弱多病"
    val c = "稍微读了点书的人，大多知道大作家鲁迅弃医从文的故事，然而大家却未必知道李时珍在从医之前也经过了一番艰苦的思想斗争。只不过他不是弃医从文，恰恰相反，他是弃文从医。</p><p>李时珍之所以在中国的历史上，尤其是医学史上具有极其崇高的地位，开始并没把从医当成自己的理想。李时珍的父亲与爷爷都是相当不错的医生，他们都希望自己家里出一个读书人，希望有一个人能够通过科举考试考取功名，走上仕途，不再行医。可是这个希望一再地落空，最后他们都把希望寄托在李时珍身上。然而令人遗憾的是，李时珍只考络配图</p><p>落榜后的李时珍读书更加刻苦，不久他娶了一个大户人家的小姐吴氏为妻，妻子并未反对他考取功名，还经常鼓励他。公元1537年李时珍第二次参加了在武昌举行的乡试，这一次，他再次榜上无名。</p><p>要不要再考呢?这时的李时珍有些犹豫，开始思考这个问题网络配图</p><p>3年后的秋天，他第三次来到武昌参加乡试，再次失败。从此，李时珍对科举考试失去了兴趣，甚至对此产生了一种恐惧心理。也是从这时候起，他暗下决心，不再参加乡试，跟随父亲学医。</p><p>其实每个人的人生都不可能一帆风顺，即便是成功人士也不例外。当自己在人生遭遇了重大创伤的时候，需要的是勇敢地去面对，并及时调整好自己的心态，积极地投入到新的生活当中去。"

    Array(Article("", t, c))

  }

  def testOnline(): Unit = {
    def getWordVec() = {
      val input = Source.fromFile("/hadoop/data01/linjiang/db/uc170626.vec")
      input.getLines().map(line => {
        val wv = line.split("[\t ]")
        if (wv.length == 2) {
          val word = wv(0)
          val vec = wv(1).split(",").map(_.toDouble)
          (word, vec)
        } else (null, null)
      }).filter(e => e._1 != null && e._2.length == 200).toMap
    }

    val wordVec = getWordVec()

    println("word vec cnt="+wordVec.size)
    val model = new ArticleClassifierOnlineModel(category, weight)

    val srcdata = getSrcData()

    srcdata.foreach(d => {
      val title = model.segment(d.title)
      val content = model.segment(d.content)
      println("title = "+title.mkString(","))
      println("content = "+content.mkString(","))

      val result = model.classify(title, content, wordVec)
      println(s"### online: ${d.title} : classify result =$result")
    })
  }

  def testOffline(): Unit = {
    val conf = new SparkConf().setAppName("news cluster")
    val sc = SparkContext.getOrCreate(conf)
    val hiveContext = new HiveContext(sc)

    val wordVec = ArticleClassifierOfflineModel.getWordVectors(hiveContext, "uc170626")

    val model = new ArticleClassifierOfflineModel(category, weight)

    val srcdata = getSrcData()

    srcdata.foreach(d => {
      val result = model.classify(d.title, d.content, wordVec)
      println(s"### offline: ${d.title} : classify result =$result")
    })

  }

